#include <iostream>
#include <vector>
#include <string>
#include <algorithm>
using namespace std;
class Solution {
public:
    void flip(vector<vector<char>>& board, int row, int col)
    {
        board[row][col] = 'P'; 
        if(row>0 && board[row-1][col]=='O')
            flip(board,row-1, col);
        if(row<board.size()-1 && board[row+1][col]=='O')
            flip(board,row+1, col);
        if(col>0 && board[row][col-1]=='O')
            flip(board,row,col-1);
        if(col<board[0].size()-1 && board[row][col+1]=='O')
            flip(board,row,col+1);
    }

    void solve(vector<vector<char>> &board) {                       
        if(board.size()<3 || board[0].size() <3)    
            return;

        int nRows = board.size();
        int nCols = board[0].size();
        int i;
        for(i=0;i<nCols-1;i++)
            if(board[0][i]=='O') flip(board,0,i);
        for(i=0;i<nRows-1;i++)
            if(board[i][nCols-1]=='O') flip(board,i,nCols-1);
        for(i=nCols-1;i>0;i--)
            if(board[nRows-1][i]=='O') flip(board,nRows-1,i);
        for(i=nRows-1;i>0;i--)
            if(board[i][0]=='O') flip(board,i,0);

        for(i=0;i<nRows;i++)
            for(int j=0;j<nCols;j++)
            {
                if(board[i][j]=='O') 
                    board[i][j] = 'X';
                else if(board[i][j]=='P')
                    board[i][j] = 'O';
            }
        return;
    }
};

